<script lang="ts">
  import { LightningTime } from "@purduehackers/time";
  import { onMount } from "svelte";

  onMount(() => {
    setInterval(() => {
      const lt = new LightningTime();
      const time = lt.convertToLightning(new Date());
      const colors = time.colors;

      const e = document.getElementById("SIGN_BOTTOM_LEFT") as HTMLElement;
      e.setAttribute("style", `fill:${colors.boltColor}`);

      for (let elem of ["SIGN_TOP", "SIGN_CENTER"]) {
        const e = document.getElementById(elem) as HTMLElement;
        e.setAttribute("style", `fill:${colors.zapColor}`);
      }

      for (let elem of ["SIGN_RIGHT", "SIGN_BOTTOM_RIGHT"]) {
        const e = document.getElementById(elem) as HTMLElement;
        e.setAttribute("style", `fill:${colors.sparkColor}`);
      }
    }, 10);
  });
</script>

